INSERT INTO movies (id, title, language, projection_start_date, projection_end_date, director_full_name, synopsis, pg_rating, duration_in_minutes, trailer_url, created_at, updated_at) VALUES ('b3ac77c0-6f59-482a-ae27-7157b18a73d6', 'The Shawshank Redemption', 'EN', '2026-02-26', '2026-06-07', 'Jane Smith', 'Imprisoned in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.', 'PG-13', '142', 'https://www.youtube.com/watch?v=PLl99DlL6b4', '2026-01-04T18:57:55.397733', '2026-01-04T18:57:55.397733');
